import React, {Component} from "react";
import validator from 'validator';
import './login.css';

export default class LoginComponent extends Component{

    validateUsername(username) {
        if (validator.isEmpty(username)) {
            return 'Username is required';
        }
        return false;
    }


    render() {
        return(
            <div id="login-component" className="container-fluid">
                <div className="card">
                    <div className="card-body">
                        <img src={require('./logo.png')}/>
                        <form>
                            <div className="form-group">
                                <input className="form-control form-control-lg" type="text" placeholder="Username"/>
                            </div>
                            <div className="form-group">
                                <input className="form-control form-control-lg" type="password" placeholder="Password"/>
                            </div>
                            <div>
                                <button className="btn btn-primary btn-lg btn-block">Sign In</button>
                            </div>
                        </form>
                        <a href="#">Click here to registration</a>
                    </div>
                </div>
            </div>
        );
    }
}
